If you want to run code block when some expression is true you need to use if keyword: // assume it's a script
use 0x0::Transaction; fun main(custom_addr: address) { if (custom_addr != Transaction::sender()) { abort 11 }; // alternatively if (custom_addr != Transaction::sender()) abort 11
} Syntax: if (<EXPRESSION>) <EXPRESSION>;

