use 0x0::Transaction; fun main(custom_addr: address) { if (custom_addr != Transaction::sender()) { abort 11 } else { let _ = true }; // alternatively if (custom_addr != Transaction::sender()) abort 11 else { let _ = true };
} Syntax with else: if (<EXPRESSION>) <EXPRESSION>
else <EXPRESSION>;

