In Move you have two ways to do repetition: conditional loop with while and infinite loop. Use while loop with bool expression inside parentheses: fun main() { let i = 0; while (i < 5) { i = i + 1; }
} For infinite (non-conditional) loops use loop keyword with expression: fun main() { let i = 0; loop { i = i + 1; if (i == 5) break }
} Syntax for loops: while (<EXPRESSION>) <EXPRESSION>;
loop <EXPRESSION>;

