Keywords continue and break allow you to skip one round or break iteration. For example let's add two conditions into loop. If i is even we use continue to jump to next iteration without going through code after continue call. With break we stop iteration and exit loop. fun main() { let i = 0; loop { i = i + 1; if (i / 2 == 0) continue; if (i == 5) break; // assume we do something here }; // i here is 5
} About semicolons. If break and continue are the last keywords in scope, you can't put a semicolon after them as any code after won't be executed. Somehow even semi can't be put. See this: fun main() { let i = 0; loop { i = i + 1; if (i == 5) { break; // will result in compiler error. correct is `break` without semi // Error: Unreachable code } // same with continue here: no semi, never; if (true) { continue } // however you can put semi like this, because continue and break here // are single expressions, hence they "end their own scope" if (true) continue; if (i == 5) break; }
}

